import React, { useState, useEffect} from 'react'
import axios from 'axios'
import { Link, useHistory } from "react-router-dom"
import styled from 'styled-components'
import { useTable } from 'react-table'


const GuidesTable = () => {
  const history = useHistory()
  const [guides, setGuides] = useState([])
  const [loading, setLoading] = useState(true)

  useEffect(() => {
    fetchGuides()

  }, []);



  const fetchGuides = async () => {
    console.log(localStorage.getItem("access_token"))
    const config = {
      headers: {
        "Content-Type": "application/json",
        "Authorization": `Bearer ${localStorage.getItem("access_token")}`
      },
    };

    try {
      //AQUI VAN LAS RUTAS DE LAS GUIAS
      const { data } = await axios.post(`${process.env.REACT_APP_API_URL}/user/guides`, {} ,config);
      setGuides(data.data)
      console.log("This are guides", data)
      setNextPage(data.next_page_url)
      setPreviousPage(data.prev_page_url)
      setCurrentPage(data.current_page)
      setFirstPage(data.first_page_url)
      setLastPage(data.last_page_url)
      setLoading(false)

    } catch (error) {
      localStorage.removeItem("authToken");
      localStorage.removeItem("email");
      localStorage.removeItem("username");
      history.push("/signin")
    }
  };



  const columns = React.useMemo(
    () => [
      {
        Header: 'Tracking Number',
        accessor: 'tracking_number'
      },
      {
        Header: 'Estado',
        accessor: 'status_id'
      },
      {
        Header: 'Tipo',
        accessor: 'shipment_type_id'
      },
      {
        Header: 'Nombre',
        accessor: 'destination_name'
      },
      {
        Header: 'Ciudad Destino',
        accessor: 'destination_city'
      },
      {
        Header: 'Pais Destino',
        accessor: 'destination_country'
      },
      {
        Header: 'Peso',
        accessor: 'weight'
      },{
        Header: 'Costo',
        accessor: 'price'
      },
      {
        Header: 'Fecha Creacion',
        accessor: 'created_at'
      }
    ]
  )

  return (
    <Styles>
      <Table columns={columns} data={guides} />
    </Styles>
  )
}


function Table({ columns, data }) {
  // Use the state and functions returned from useTable to build your UI
  const [currentPage, setCurrentPage] = useState();
  const [nextPage, setNextPage] = useState();
  const [previousPage, setPreviousPage] = useState();
  const [firstPage, setFirstPage] = useState();
  const [lastPage, setLastPage] = useState();


  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow,
  } = useTable({
    columns,
    data,
  })

  // Render the UI for your table
  return (

    <>
    <table {...getTableProps()}>
      <thead>
        {headerGroups.map(headerGroup => (
          <tr {...headerGroup.getHeaderGroupProps()}>
            {headerGroup.headers.map(column => (
              <th {...column.getHeaderProps()}>{column.render('Header')}</th>
            ))}
          </tr>
        ))}
      </thead>
      <tbody {...getTableBodyProps()}>
        {rows.map((row, i) => {
          prepareRow(row)
          return (
            <tr {...row.getRowProps()}>
              {row.cells.map(cell => {
                return <td {...cell.getCellProps()}>{cell.render('Cell')}</td>
              })}
            </tr>
          )
        })}
      </tbody>
    </table>
    <PaginationWrapper class="pagination">
      <PaginationLink class="page-item"><a href={firstPage}>Comienzo</a></PaginationLink>
      <PaginationLink class="page-item"><a href={previousPage}>Anterior</a></PaginationLink>
      <PaginationLink class="page-item"><a href="#">{currentPage}</a></PaginationLink>
      <PaginationLink class="page-item"><a href={nextPage}>Siguiente</a></PaginationLink>
      <PaginationLink class="page-item"><a href={lastPage}>Ultima</a></PaginationLink>
    </PaginationWrapper>
  </>
  )
}

const PaginationWrapper = styled.nav`
  display: flex;
  flex-direction: row;
  list-style: none;
  background-color: purple;
  align-items: center;
  justify-content: center;
  box-sizing: border-box;
  padding-top: 15px;
`

const PaginationLink = styled.li`
  box-sizing: border-box;
  padding-left: 6px;
  padding-right: 6px;
  font-size: 20px;
`


const Styles = styled.div`
  padding: 1rem;

  table {
    border-spacing: 0;
    border: 1px solid black;

    tr {
      :last-child {
        td {
          border-bottom: 0;
        }
      }
    }

    th,
    td {
      margin: 0;
      padding: 0.5rem;
      border-bottom: 1px solid black;
      border-right: 1px solid black;

      :last-child {
        border-right: 0;
      }
    }
  }
`

const SectionWrapper = styled.div`
  width: 100%;
  background-color: green;
`

export default GuidesTable
